import api from "../api";

const DeleteWorkout = () => {

    let workout_id = 0;

    workout_id = localStorage.getItem("workout_id");
   

    api.delete(`/workouts/${workout_id}`).then(response => {
        console.log(workout_id);
        //console.log(response.data);
    });

}



export default DeleteWorkout;
